import React, { Component } from 'react';


class  Prstest extends Component{
    constructor(){
        super()
    }

    render(){
        return (
            <div className='mt-5 col-md-4 col-sm-6  text-center'>
                <div className='card'>
                    <div className='card-header'>
                        <img style={{maxWidth:'100%'}} src={this.props.info.img} alt='' />
                    </div>
                    <div className='card-body' style={{ backgroundColor : props.info.website ? 'white' : 'aquamarine'}}>
                        <h5 >{props.info.nom}</h5>  
                        <p>{props.info.travail}</p>
                        <p>{props.info.email}</p>
                        <p>{props.info.telephone}</p>
                        <p>{props.info.website}</p>
                    </div>
                </div>    
            </div>
        );
    }
   
}

export default Prstest;
